import * as React from "react";
import { Redirect } from 'react-router-dom';
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
import axios from "axios";
// GraphQL 
const GET_USER_SETTINGS = gql`
    query getUser {
        getUser {
            _id
            name
            email
        }
    }
`;
const UPDATE_USER = gql`
    mutation updateUser($UserInput: UserInput!) {
        updateUser(UserInput:$UserInput)
    }
`;
const S3_GENERATE_URL = gql`
    mutation s3GenerateUrl($Key: String, $ContentType: String) {
        s3GenerateUrl(Key:$Key, ContentType:$ContentType) {
            url
            name
            fileType
        }
    }
`;

//
// Function
//

const UserSettings: React.FunctionComponent<{}> = () => {
    // Set States
    const [userSettings, setUserSettings] = React.useState(null);
    const [uploadFile, setUploadFile] = React.useState(null);
    // GraphQL - Q's
    const { loading, error, data } = useQuery(GET_USER_SETTINGS);
    // GraphQL - M's
    const [ updateUser, { loading:userUpateLoading, error:userUpateError }] = useMutation(UPDATE_USER);
    const [ s3GenerateUrl, { loading:s3GenerateUrlLoading, error:s3GenerateUrlError }] = useMutation(S3_GENERATE_URL);

    //
    // Check & Set Data
    //

    if(data && !loading && !error) {
        if(!userSettings) {
            setUserSettings(data.getUser)
        }
    }

    //
    // OnChange
    //

    const onChange = (event) => {
        let newData = {...userSettings}; 
        newData[event.target.name] = event.target.value; 
        setUserSettings(newData);
    }

    // 
    // Get Image
    //

    const getImage = (e) => {
        const files = e.target.files;
        if (files && files.length > 0) {
          const file = files[0];
          setUploadFile({ file });
        }
    };

    //
    // Upload Avatar
    //

    const uploadAvatar = async (event) => {
        event.preventDefault();
        const { file } = uploadFile;
        try {
            const ext = file.name.slice((file.name.lastIndexOf(".") - 1 >>> 0) + 2);
            const name = Math.floor(Date.now() / 1000);
            const res = await s3GenerateUrl({
                variables: {
                    Key: name+'.'+ext,
                    ContentType: file.type
                }
            });       
            if(res.data.s3GenerateUrl) {                               
                const aws = await axios.put(res.data.s3GenerateUrl.url, file, {
                    headers: { 'Content-Type':res.data.s3GenerateUrl.fileType, 'x-amz-acl': 'public-read' }
                } )
                if(await aws) {
                    if(aws.status === 200) {
                        const res = await updateUser({
                            variables: {
                                UserInput: { _id:userSettings._id, avatar:name+'.'+ext }
                            }
                        });
                         if(res.data.updateUser) {
                             console.log("User has been updated!");
                         } 
                    } else {
                        console.log('Error has occured');
                    }                 
                }
            }
        } catch(err) {
          console.log(`Error (`+err+`)`);
        }
    }

    //
    // Submit Update
    //

    const submitUser = async () => {
        event.preventDefault();
        try {
            console.log(userSettings)
            const res = await updateUser({
                variables: {
                    UserInput: userSettings
                }
            });
            if(res.data.updateUser) {
                console.log("User has been updated!");
            } else {
                console.log(res)
            }
        } catch(err) {
          console.log(`Error (`+err+`)`);
        }
    }

    // Return
    return (
        <>   
            {loading && <p>Loading Settings...</p>}   
            {userSettings && 
                <>
                <h3>Upload Avatar</h3>
                <input
                   id='upload-user-avatar-image'
                   type='file'
                   accept='image/*'
                   onChange={getImage}
                />
                <form onSubmit={uploadAvatar}>
                   <button id="user-upload-button">Upload</button>
                </form>
                <br/><br/>
                </>
            }
            {userSettings && 
                <form onSubmit={submitUser}>
                    <input type="text" onChange={(event) => onChange(event)}  name="email" placeholder="Email Address" value={userSettings.email || ""}/><br/>
                    <input type="text" onChange={(event) => onChange(event)} name="name" placeholder="Full Name" value={userSettings.name || ""}/><br/>
                    {userUpateLoading && <p>Updating User...</p>}
                    <button>Update User</button>
                </form>
            }
        </>
    );
};

export default UserSettings
